class GoTopComponent extends Component {
    render() {
        return (
            <>
                <div className="go-top">
                    <a href="#" className="go-top-btn">
                        <img src="./images/btn_prom_up.png" alt="go Top 버튼"/>
                    </a>
                </div>
            </>
        );
    }
}

export default GoTopComponent;
